import logo from './logo.svg';
import './App.css';


const Buttion = (name) =>{
  return <button>name</button>
}


function App() {
  return (
    <div className="App">
      <header className="App-header">
        Hello world!
      </header>
      <Buttion></Buttion>
    </div>
  );
}

export default App;
